import React from 'react';
import { Container, Box, Typography, Link } from '@mui/material';

const LandingPage = () => {
  return (
    <div>
      <Container maxWidth="lg">
        {/* Full-height section with text */}
        <Box
          style={{
            minHeight: '100vh',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'flex-start',
          }}
        >
          {/* Updated text alignment and content */}
          <Box style={{ marginLeft: '15%' }}>
            <Typography variant="h4">
              currently building
            </Typography>
            <Typography variant="h4">
              hopefully cool things
            </Typography>
            <Typography variant="body1" color="textSecondary">
              Hi, I'm Jack. I am an engineer who likes to build cool products in AI, crypto, and space.
            </Typography>
            <Typography variant="body1" color="primary">
              <Link href="/projects">
                SEE MY PROJECTS ->
              </Link>
            </Typography>
          </Box>
        </Box>

        {/* Your existing content */}
        <Box textAlign="center" my={4}>
          <Typography variant="h6">Interested in my work?</Typography>
          <Link href="/projects" color="primary">
            View My Projects
          </Link>
        </Box>
      </Container>
    </div>
  );
};

export default LandingPage;
